import { Component } from '@angular/core';
import { Employee } from '../employee';
import { EmployeeService } from '../employee.service';

import { Router } from '@angular/router';
@Component({
  selector: 'app-employee-list',
  templateUrl: './employee-list.component.html',
  styleUrls: ['./employee-list.component.css']
})
export class EmployeeListComponent {

  employees: Employee[];
  inputId!:number;
  id!:number;
  constructor(private employeeService: EmployeeService,  private router: Router) {
    this.employees=[]
   }

  ngOnInit(): void {

    // this.employees = [
    //   { "id":1,fname: 'John', lname: 'Doe', email: 'john@example.com', salary: 50000, department: 'IT', designation: 'Developer' },

    // ];

    this.getEmployees();
  }


  goToEmployee(){

    this.id=this.inputId;
    console.log(this.id); 
    // this.router.navigate(['/home']);
  }

  getEmployees(){
    this.employeeService.getEmployeesList().subscribe(data => {this.employees = data;});


  }

  updateEmployee(id: number){
    this.router.navigate(['updating-by-id', id]);
  }




  deleteEmployee(id: number){
    this.employeeService.deleteEmployee(id).subscribe( data => {
      console.log(data);
      this.getEmployees();
    })
  }


  detailsOfEmployee(id: number){
    this.router.navigate(['details-of-employee', id]);
  }


}
<br>
<br>
<!-- <h1>Employee List</h1> -->

<div class="container">

    <div class="col-md-6 offset-md-3  container-sm ">
        <form (ngSubmit)="goToEmployee()" class="row g-3 form-container  container-sm">
            <div class="form-group col-md-6 inline ">

                <input type="text" class="form-control" id="inputId" [(ngModel)]="enteredId" placeholder="Search by ID">
                <button class="btn btn-secondary " type="submit">Search</button>
            </div>
        </form>

    </div>
    <br>
    <br>

<table style="margin-bottom: 50px;" class=" table table-responsive table-striped  border-dark abc">

    <thead class="table-dark thead-dark ">
        <tr>
            <!-- <th>Id</th> -->
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Salary</th>
            <th>Department</th>
            <th>Designation</th>
            <th>Joining Date</th>
            <th>Actions</th>
        </tr>

    </thead> 


    <tbody>
        <tr *ngFor = "let employee of employees">
            <!-- <td>{{employee.id}}</td> -->
            <td>{{employee.fname}}</td>
            <td>{{employee.lname}}</td>
            <td>{{employee.email}}</td>
            <td>{{employee.salary}}</td>
            <td>{{employee.department}}</td>
            <td>{{employee.designation}}</td>
            <td>{{employee.joiningDate}}</td>
            <td>
                <button (click) = "updateEmployee(employee.id)" class = "btn  btn-secondary btn-sm"> Update</button>
                <button (click) = "deleteEmployee(employee.id)" class = "btn btn-danger btn-sm" style="margin-left: 10px"> Delete</button>
                <button (click) = "detailsOfEmployee(employee.id)" class = "btn btn-success btn-sm " style="margin-left: 10px"> View</button>
            </td>
        </tr>
    </tbody>


</table>
</div>
